    function changeChoice() {
        setChoice(choice)
    }


    return (
        <div className="App">
            <h1>Замовлення редагування</h1>
            <fieldset className="btn">
                <legend></legend>
                <input type="checkbox" id="service"/>
                <label>Послуга</label>
